import React from 'react';
import './card.css';

export default function Card(props) {
  return (
    <div className='Card'>
      <h3>{props.title}</h3>
      <p>{props.content}</p>
      <button type='button' onClick={props.onDeleteItem}>Delete Card</button>
    </div>
  )
}
